  [],\n\t\"revision_timestamp\": \"2016-07-27T22:25:06.729058\",\n\t\"name\": \"natural-resources-management-plan-for-naval-air-facility-midway-island\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Included within this plan are recommendations
  to minimize conflicts and take advantage of opportunities to provide a balance between
  natural resources and man at NAF Midway. Implementation of this plan will take advantage
  of the cooperative efforts of the U.S. Navy, U.S. Fish and Wildlife Service, base
  contractor, volunteers, and researchers. Although this plan is divided into several
  management areas, because of NAF Midway's small size and density of wildlife resources,
  most of the specific management recommendations are interrelated and are thus difficult
  to lump into one area. For example, in order to reduce bird aircraft strike hazards,
  cleared areas near the airfield should be replanted with native shrubs to provide
  less desirable habitat for albatross nesting. In order to encourage these plants,
  herbivorous rodents and competing introduced plants must be controlled.\",\n\t\"license_title\":
